embedfield:
How to handle unordered bucket boundaries in mongodb?<p>I need to retrieve all profile views a user received within 15 days. I made a working query that group all views by day.</p>
<p>A view is a very simple document:</p>
<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>{
viewerId: string,
username: string,
profileId: string,
day: 4
}
 </code></pre>
</div>
</div>
</p>
<p>The <code>day</code> key matches the current day of the month when the view was stored. So I made this query:</p>
<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>static getProfileViews(userId: string) {
    const fifteenDaysRange = this.getDaysRange(15);
    return ProfileViewsDB.aggregate([
      { $match: { profileId: userId } },
      {
        $bucket: {
          groupBy: "$day",
          boundaries: fifteenDaysRange,
          default: fifteenDaysRange[fifteenDaysRange.length - 1] + 1,
          output: {
            count: {
              $sum: 1,
            },
            viewers: {
              $push: {
                _id: "$viewerId",
                username: "$username",
              },
            },
          },
        },
      },
    ]);
  }</code></pre>
</div>
</div>
</p>
<p>It works, except when the days range is across two months. So the boundaries are: <code>[29 ,30, 31, 1, 2, 3, 4]</code>, instead of a regular incremental list. In this case, mongo crashes, claiming that the boundaries must be properly ordered.</p>
<p>How to fix this? Is there a trick here to handle this edge-case?</p>

