Getting total number of likes that user received by going through all his/her posts MongoDB<p>I'm currently using MERN stack to create a simple SNS application.</p>
<p>However I got stuck trying to come up with a query that could go through all of the post that user posted and get the sum of likes.</p>
<p>Currently I've created 3 Schemas. User, Post, Reply.</p>
<h2><strong>User</strong></h2>
<pre><code>  const userSchema = new Schema({

   facebookId: {
    required: true,
    type: String,
  },

  username: {
    required: true,
    type: String,
  },

  joined: Date
})
</code></pre>
<h2><strong>POST</strong></h2>
<pre><code>const postSchema = new Schema({
  title: String,
  body: String,
  author: { type: Schema.Types.ObjectId, ref: &quot;User&quot; },
  datePosted: Date,
  reply: [{ type: Schema.Types.ObjectId, ref: 'Reply'}],
  tag: [ {type: String} ]

});
</code></pre>
<h2><strong>REPLY</strong></h2>
<pre><code> const replySchema = new Schema({
      title: String,
      body: String,
      author: { type: Schema.Types.ObjectId, ref: &quot;User&quot; },
      datePosted: Date,
      post: [{ type: Schema.Types.ObjectId, ref: 'Post'}],
      likes: [{ type: Schema.Types.ObjectId, ref: &quot;User&quot; }] // storing likes as array 
    });
</code></pre>
<p>As you can see I have added <strong>likes</strong> field in Reply Schema as an array that takes in User ObjectId.
Say some user has posted 4 replies and each of them received 1 ,3, 4, 5 likes respectively. In the leaderboard section I want to display user info with the total number of counts that they received from all of their replies which is 1+3+4+5 = 13 likes.</p>
<p><strong>Can this be achieved without adding additional fields or is there a better way of structuring the schema.</strong></p>

